import React from 'react';
import './Section.css';

function Rabbit() {
  return (
    <div className="section rabbits-rodents">
      <h2>Rabbits & Rodents</h2>
      <p>Little Munchkins!</p>
      <p>
        Our store offers a wide range of products for your small pets including food, habitats, and accessories. Ensure your rabbits, hamsters, and other small pets are well-cared for with our selection.
      </p>
      <button>Shop Now</button>
    </div>
  );
}

export default Rabbit;
